import axios from 'axios'
import React, { useEffect, useState } from 'react'

export default function Hero() {
const [state ,setState]=useState([])

const fatfhData = ()=>{
  const array = []
  
  axios.get('https://api.github.com/users')
  .then((res)=>{
    console.log(res.data)
    const doc = res.data
    array.push(doc)
    setState(array)
  })
}
useEffect(()=>{
fatfhData()
},[])
return (
<>
<h1>{state}</h1>
</>  )
}
